import React from 'react';
import Grid from '@material-ui/core/Grid';

const Content: React.FC = () => {
  return (
    <Grid item container>
      <Grid item xs={false} sm={1} />
      <Grid>Content</Grid>
    </Grid>
  );
};
export default Content;
